import { Fragment } from 'react';
import './App.css';

function App() {

  function ImageCar({source,description}) {

    return(
     <img src={source} alt={description}></img>)
  }

  function Title ({text}) {
    return (
      <h1>{text}</h1>
    )
  }

  function Description ({text}) {
    return (
      <p>{text}</p>
    )
  }

  return (
    <div className='car'>
      <ImageCar src="https://images.unsplash.com/photo-1619362280026-accdce53f512?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1000&q=80" alt="BMW" />
      <Title text="My BMW"></Title>
      <Description text="My BMW is blue."></Description>
      <Description text="It's a bit older, from 2011."></Description>
    </div>
  )

}

export default App;
